import React from "react";
import { Link } from "react-router-dom";
import "./ClassListNavigation.css";

const ClassListNavigation = () => {
  return (
    <nav>
      <ul>
        <li>
          <Link to="/code-block-page-1">Code Block Page 1</Link>
        </li>
        <li>
          <Link to="/code-block-page-2">Code Block Page 2</Link>
        </li>
        <li>
          <Link to="/code-block-page-3">Code Block Page 3</Link>
        </li>
        <li>
          <Link to="/code-block-page-4">Code Block Page 4</Link>
        </li>
      </ul>
    </nav>
  );
};

export default ClassListNavigation;
